<div id="guide">
<div class="left">
<h3>お支払い方法</h3>
<p>代金引換・銀行振込・郵便振替・クレジットカードがご利用いただけます。銀行振込・郵便振替の場合は、ご入金確認後の発送となります。</p>
<p><img src="http://image.rakuten.co.jp/hinode-syoukai/cabinet/pay.gif" width="345" height="100" alt=""/></p>
<p>※お振込手数料はお客様負担とさせていただきます。<br>
※ご注文から一週間以内のご入金をお願いします。<br>
※お急ぎの場合は、クレジットカードまたは代金引換をご利用ください。</p>
</div>
<div class="right">
<h3>配送について</h3>
<p>当社指定業者より配送させていただきます。<br>
なお、海外発送は行っておりませんので予めご了承ください。</p>
<p>お届け日は３日後以降からご指定いただけます。お急ぎの場合は、お電話（0745-52-0028）にてお問い合わせください。<br>
※一部の山間部や離島地域では、日付・時間帯指定を承れない場合もございますので、何卒ご了承下さい。</p>
<p><img src="http://image.rakuten.co.jp/hinode-syoukai/cabinet/pos.gif" width="345" height="100" alt=""/></p>
